import React from "react";
import DatePicker from "react-datepicker"
import "react-datepicker/dist/react-datepicker.css";

class Form extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      laaneBelop: null,
      nominellRente: null,
      terminGebyr: null,
      utlopsDato: null,
      saldoDato: null,
      datoForsteInnbetaling: null,
    };
  }
  mySubmitHandler = (event) => {
    event.preventDefault()
    alert("You are submitting " + this.state.laaneBelop);
    let companies =
    {
        laanebelop: this.state.laaneBelop,
        nominellRente: this.state.nominellRente,
        terminGebyr: this.state.terminGebyr,
        utlopsDato: this.state.utlopsDato,
        saldoDato: this.state.saldoDato,
        datoForsteInnbetaling: this.state.datoForsteInnbetaling,
        ukjentVerdi: "TERMINBELOP"
    }
    console.log(JSON.stringify(companies))
  };
  myChangeHandler = (event) => {
    let nam = event.target.name;
    let val = event.target.value;
    this.setState({ [nam]: val });
  };
  render() {
    return (
      <form onSubmit={this.mySubmitHandler}>
        <h1>Hello {this.state.datoForsteInnbetaling}</h1>
        <input
          type="number"
          name="laaneBelop"
          onChange={this.myChangeHandler}
        />
        <input
          type="number"
          name="nominellRente"
          onChange={this.myChangeHandler}
        />
        <input
          type="number"
          name="terminGebyr"
          onChange={this.myChangeHandler}
        />
        <input 
            type="date" 
            name="utlopsDato" 
            onChange={this.myChangeHandler} />
        <input 
            type="date" 
            name="saldoDato" 
            onChange={this.myChangeHandler} />
        <input
          type="date"
          name="datoForsteInnbetaling"
          onChange={this.myChangeHandler}
        />
        <DatePicker
            dateFormat="yyyy/MM/dd"
        />
        <input 
            type="submit"
        />
      </form>
    );
  }
}

export default Form;
